import React from 'react';
import ReactDOM from 'react-dom';
import favTeacher, {favSub} from './App';
ReactDOM.render(
    <>
        <ol>
            <li> Nishi </li>
            <li> {favTeacher} </li>
            <li> {favSub} </li>
        </ol>
    </>,
    document.getElementById('root')
);

